import {deployContractByHexString, deployContractByPath, DeployType, getDeployScriptConfig} from "../../service/deploy";
import {ACCOUNT_PRIVATE_1, ACCOUNT_PRIVATE_2, CKB_RPC_URL, RPCClient} from "../../config/config";
import {generateAccountFromPrivateKey, waitTransactionCommit} from "../../service/txService";
const CKB_LIGHT_CLIENT_CONTRACT_BIN = "";
const EMPTY_CONTRACT_BIN = "";
describe('contract', function () {

    this.timeout(1000000)
    it("query msg",async ()=>{

        console.log(generateAccountFromPrivateKey(ACCOUNT_PRIVATE_2))

    })
    it('deploy', async ()=> {
        const tx = await deployContractByPath(ACCOUNT_PRIVATE_1,
            "/Users/guopenglin/WebstormProjects/gp12/ckb-js-integration-test/service/contract/LoopContractBin",
            DeployType.typeId
            )

        console.log('seal tx:',JSON.stringify(tx))
        const txMsg = await RPCClient.sendTransaction(tx)
        console.log('tx hash:',txMsg)
        await waitTransactionCommit(txMsg,CKB_RPC_URL,100)
        const script = await getDeployScriptConfig(txMsg,0,DeployType.typeId)
        console.log(script)

    });

    it("get data",async ()=>{
        const transaction = await RPCClient.getTransaction("0xce366d54d279f436af41753d14ab9fa2743e523db4afaf8e5d0e8bd8ae9e7af4")
        console.log(transaction.transaction.outputsData[0])
    })
    it("deploy CKB_LIGHT_CLIENT_CONTRACT_BIN",async ()=>{

        let tx = await deployContractByHexString(ACCOUNT_PRIVATE_1,
            CKB_LIGHT_CLIENT_CONTRACT_BIN,
            DeployType.typeId
            )

        console.log('seal tx:',JSON.stringify(tx))
        const txMsg = await RPCClient.sendTransaction(tx)
        console.log('tx hash:',txMsg)
        await waitTransactionCommit(txMsg,CKB_RPC_URL,100)
        const script = await getDeployScriptConfig(txMsg,0,DeployType.typeId)
        console.log(script)
    })
    it("deploy empty lock",async()=>{
        let tx = await deployContractByHexString(ACCOUNT_PRIVATE_1,
            EMPTY_CONTRACT_BIN,
            DeployType.typeId
        )

        console.log('seal tx:',JSON.stringify(tx))
        const txMsg = await RPCClient.sendTransaction(tx)
        console.log('tx hash:',txMsg)
        await waitTransactionCommit(txMsg,CKB_RPC_URL,100)
        const script = await getDeployScriptConfig(txMsg,0,DeployType.typeId)
        console.log(script)
    })

});